    <div>
      <Header />
        {notes.map(function createNotes(noteItems) {
  return (
    <Note
      key={noteItems.key}
      title={noteItems.title}
      content={noteItems.content}
    />
  );
})}
      <Footer />
    </div>
  );
}

export default App;
